import React, { useState } from 'react';
import './NewSet.scss';

const NewSet = props => {
  function onSubmit(event) {
    event.preventDefault();
    console.log(event);
    props.toggleModal();
  }

  return (
    <form onSubmit={onSubmit} id="new-set">
      <input type="number" value="2" required="true" placeholder="weight" />
      <input type="number" value="2" required="true" placeholder="reps" />
      <input type="number" value="2" required="true" placeholder="rpe" />
      <input type="button" value="2" value="CANCEL" onClick={props.toggleModal} />
      <input type="submit" value="ENTER" />
    </form>
  );
};

export default NewSet;
